        dx = x2 - x1
        dy = y2 - y1
        a = dx ** 2 + dy ** 2
        h = 2 * r1 * r2
        c = (dx ** 2 + dy ** 2 - r1 ** 2 - r2 ** 2) / (2 * h)
        d = c * c - a
        if d >= 0:
            t = (-c + math.sqrt(d)) / h
            x3 = x1 + t * dx
            y3 = y1 + t * dy
            x4 = x1 - t * dx
            y4 = y1 - t * dy
            return abs(x3 * y4 - x4 * y3)
        else:
            return 0

    def circle_intersection_angle(x1: float, y1: float, r1: float, x2: float, y2: float, r2: float) -> float:
        dx = x2 - x1
        dy = y2 - y1
        a = dx ** 2 + dy ** 2
        h = 2 * r1 * r2
        c = (dx ** 2 + dy ** 2 - r1 ** 2 - r2 ** 2) / (2 * h)
        d = c * c - a
        if d >= 0:
            t = (-c + math.sqrt(d)) / h
            x3 = x1 + t * dx
            y3 = y1 + t * dy
            x4 = x1 - t * dx
            y4 = y1 - t * dy
            return math.degrees(math.acos((x3 * x4 + y3 * y4) / (distance(x1, y1, x3, y3) * distance(x1, y1, x4, y4))))
        else:
