def solution(stdin: str) -> str:
    n, m = map(int, stdin.split())
    edges = []
    for _ in range(m):
        u, v, w = map(int, stdin.split())
        edges.append((u - 1, v - 1, w))

    def find_parent(parent, u):
        if parent[u] == u:
            return u
        return find_parent(parent, parent[u])

    def union_by_rank(parent, rank, u, v):
        u_root = find_parent(parent, u)
        v_root = find_parent(parent, v)
        if u_root == v_root:
            return
        if rank[u_root] < rank[v_root]:
            parent[u_root] = v_root
        elif rank[u_root] > rank[v_root]:
            parent[v_root] = u_root
        else:
            parent[v_root] = u_root
            rank[u_root] += 1

    def kruskal(edges):
        parent = [i for i in range(n)]
        rank = [0] * n
        edges.sort(key=lambda x: x[2])
        result = 0
        used = set()
        for edge in edges:
            u, v, w = edge
            if u, v in used:
                continue
            parent_u = find_parent(parent, u)
            parent_v = find_parent(parent, v)
            if parent_u!= parent_v:
                union_by_rank(parent, rank, u, v)
                result += w
                used.add((u, v))
        return result

    mst_cost = kruskal(edges)
    initial_mst_cost = min(mst_cost, 10**9)
    result = 0
    for edge in edges:
        u, v, w = edge
        if w > initial_mst_cost:
            result += 1
    return str(result)

