                min_dist = dist[v]
        for v in range(1, n + 1):
            if dist[v] == min_dist:
                prev[v] = u
                dist[v] = 0
        return min_dist

    def bellman_ford(graph: List[List[Tuple[int, int]]], n: int) -> List[int]:
        dist = [float('inf')] * (n + 1)
        dist[1] = 0
        prev = [-1] * (n + 1)
        for _ in range(m):
            min_dist = float('inf')
            for i in range(1, n + 1):
                for u, w in graph[i]:
                    if dist[u] + w < dist[i]:
                        dist[i] = dist[u] + w
                        prev[i] = u
            if min_dist == float('inf'):
                return []
        return dist, prev

    def kth_smallest_path(dist: List[int], prev: List[int], k: int) -> int:
        result = 0
        for v in range(1, n + 1):
            result += dist[v]
            k -= 1
            if k == 0:
                break
            u = prev[v]
            if u == -1:
                continue
            result += dist[v] - dist[u]
        return result

