        distances = {start: 0}

        while pq:
            u = heapq.heappop(pq)
            if u in distances:
                continue

            for v, w in graph[u]:
                alt = distances[u] + w
                if alt < distances.get(v, float('inf')):
                    distances[v] = alt
                    heapq.heappush(pq, v)

        return [(u, distances[u]) for u in distances]

    def optimal_road(start: int) -> Tuple[int, int]:
        distances = dijkstra(start)
        min_cost = float('inf')
        for a, b, w in roads:
