    index = 0

    while index < len(steps) - 1:
        current_step = steps[index]
        next_step = steps[index + 1]

        if current_step < next_step:
            steps.insert(index + 1, current_step)
            steps.pop(index)
        else:
            index += 1

    steps.sort()

    def is_rectangle(rectangles, height, width):
        for rect in rectangles:
            if rect[0] <= height and rect[1] <= width and rect[2] >= height and rect[3] >= width:
                return True
        return False

    def calculate_area(rectangles):
        area = 0
        for rect in rectangles:
            area += rect[0] * rect[1]
        return area

    def calculate_largest_area(rectangles):
        max_area = 0
        for height in range(steps[0], steps[-1] + 1):
            for width in range(steps[0], steps[-1] + 1):
                if is_rectangle(rectangles, height, width):
                    area = calculate_area([(height, width, height, width)])
                    if area > max_area:
                        max_area = area
        return max_area

